r($,"bQC","bdC",()=>{var q="assets/images/bod1.png",p="5.0",o="25/02/2025"
return A.b([A.hH("Esperanza","30/04/2025","Boda absolutamente \xe9pica gracias a Aitor. Desde que nos pusimos en contacto con \xe9l, una persona cercana y que tuvo en cuenta todas nuestras preferencias para que la boda fuera un \xe9xito. El d\xeda de la boda, atento y adaptando la m\xfasica para que en todo momento no se parara de bailar. Nuestros amigos no recuerdan una boda como la nuestra y parte fue gracias a Aitor. Si nos volvi\xe9ramos a casar estar\xedas en nuestro equipo! Gracias por ponerle m\xfasica a los mejores momentos de nuestra boda",q,p),A.hH("Irene","29/04/2025","Tuvimos la suerte de que Angel fuese el DJ de nuestra boda y fue el mejor!! Supo exactamente que tipo de musica poner en cada momento y la gente (y por supuesto nosotros, los novios) estuvimos sin parar de bailar durante toda la barra libre. De 10!!!! ",q,p),A.hH("Luis","14/04/2025"," Tuvimos a Adri (https://linktr.ee/dimelobeta) para la ceremonia de nuestra boda el 12/04/2025, en Jardines de San Telmo.Se adapt\xf3 perfectamente a nuestro estilo de boda que era mix de m\xfasica argentina, internacional y espa\xf1ola, supo combinar perfectamente los estilos y le puso muy buena onda. Estamos encantados!",q,p),A.hH("Pablo","09/04/2025","Adrian, tambien llamado art\xedsticamente \u201cdimelobeta\u201d ha sido clave en que nuestra boda fuese un \xe9xito. Desde el primer momento super atento, tanto \xe9l, como todo su equipo de Marque\xe9 audiovisuales meses antes de la boda. Adri, supo leer en todo momento lo que quer\xedamos. En la ceremonia, coctail y banquete cuadr\xf3 todo perfectamente. Pero ya en la fiesta\u2026 fue sublime. El entarimado con el dj justo en la sala es un plus y la gente lo agradeci\xf3. Todos los invitados se sintieron mucho m\xe1s integrados y la variedad musical y mezclas fue de aut\xe9ntico profesional. Pd. Adem\xe1s tuvo el generoso detalle de hacernos un v\xeddeo-resumen de todos los momentos bonitos del d\xeda. Sencillamente un crack, 100% recomendable ",q,p),A.hH("Miriam","31/03/2025","Repetir\xeda una y mil veces m\xe1s una boda como la nuestra con Marquee audiovisuales, en especial con Germ\xe1n! Fue una experiencia inolvidable. Muchas gracias por todo !!!! ",q,p),A.hH("Miguel","16/03/2025","Durante todo el proceso de contrataci\xf3n y organizaci\xf3n de la m\xfasica de nuestra boda, estuvimos en contacto con todo el equipo de Marquee audiovisuales. Conseguimos que todo se adaptar\xe1 a nuestras necesidades y que el presupuesto estuviera ajustado sin renunciar a calidad y profesionalidad. Nuestro DJ fue DJ Pepe y, tras mantener una reuni\xf3n los d\xedas antes con \xe9l, todo sali\xf3 perfecto. Pedimos una hora extra de barra libre porque estaba siendo un fiest\xf3n.",q,p),A.hH("Mar\xeda","06/03/2025","Mi boda fue el 28 de febrero, y Adri\xe1n fue el DJ que estuvo ah\xed. La gente no paro de bailar y \xe9l de animar la fiesta sin parar. Fue una fiesta como la que quer\xedamos....que d\xedas despu\xe9s los invitados la record\xe1sen. En resumen...... incre\xedble!!!! ",q,p),A.hH("Roc\xedo","27/02/2025","Excelente trabajo. Le propusimos hacer un bingo y no puso problema, al contrario. Nos ayud\xf3 a elegir el momento perfecto para darle los regalitos a nuestras madres. Nos llam\xf3 y estuvimos repasando las canciones para cada momento. Super atento a nosotros en cada momento y muy divertido. Adri\xe1n, no olvidaremos este d\xeda y su banda sonar\xe1. Gracias \ud83d\ude0a",q,p),A.hH("Adri\xe1n",o," Muchas gracias a Adri\xe1n nuestro DJ, siempre atento y dispuesto. Un trabajo muy profesional, incluso ha tenido un detalle con nosotros, sin duda volver\xedamos a elegirlo a \xe9l.",q,p),A.hH("Teresa","20/02/2025","DJ Pepe fue incre\xedble m\xfasica variada y ambiente perfecto. 100% recomendable",q,p),A.hH("Lidia",o,"Fue sencillo trabajar con Maequee pre-boda y el resultado en el d\xeda clave fue Excelente. No sabemos qui\xe9n se lo pas\xf3 mejor. Nosotros lo pasamos de 10, los invitados lo pasaron de 10 pero es que Dj Adri\xe1n / @dimelobeta estaba plet\xf3rico, no par\xf3 de poner temazo tras temazo. Nuestros pies lo han sufrido pero nos ha dejado a todos el coraz\xf3n contento. Por supuesto, muy recomendable.",q,p),A.hH("Lourdes","27/01/2025","Ten\xedamos unas expectativas alt\xedsimas por los comentarios que hab\xedamos le\xeddo sobre Aitor y por lo bien que nos hab\xeda tratado en las reuniones previas, y aunque parec\xeda dif\xedcil, las super\xf3 con creces. No es simplemente alguien que pone m\xfasica, es un aut\xe9ntico avi\xf3n creando el ambiente y la fiesta a tu medida. Tiene una capacidad impresionante para leer a la gente, saber lo que les gusta y conseguir que todo el mundo se lo pase genial. Se nota su experiencia en bodas de todo tipo y se adapt\xf3 perfectamente tanto a lo que quer\xedamos nosotros como a lo que ped\xeda la fiesta en cada momento, adem\xe1s nos dio consejos buen\xedsimos que marcaron la diferencia.",q,p),A.hH("Mar\xeda","08/01/2025","Elegir a Aitor como Dj de nuestra boda fue la mejor elecci\xf3n! Hizo que la boda fuese perfecta y los invitados se lo pasaran de maravilla, lo m\xe1s comentado de la boda ha sido la fiesta, los temazos y el buen rollo que se cre\xf3 gracias a \xe9l. Sin duda lo recomiendo 100%!!",q,p),A.hH("Marta","31/12/2024","Tuvimos suerte cuando \xc1ngel Medina Dj fue el elegido para nuestra boda. Se prest\xf3 a todo y estuvo pendiente de todos los momentos especiales. Gracias",q,p),A.hH("Adri\xe1n","30/01/2025","Fue incre\xedble poder contar con Marquee Audiovisuales. Hicieron realidad todo lo que ten\xedamos en mente y consiguieron hacer que la fiesta fuese de ensue\xf1o. Hicieron que nuestra boda tuviese los momentos m\xe1s especiales y \xfanicos que uno se pueda imaginar. Los recomendamos por encima de todas las cosas y repetir\xedamos ese d\xeda una y mil veces.",q,p),A.hH("Lydia","20/12/2024","Fue todo un acierto desde el principio, la conexi\xf3n que sentimos y la sinergia no se puede explicar ... siempre preparado para darlo todo, animando a la gente hasta el final y remontando la fiesta cuando m\xe1s falta hac\xeda. Nuestra boda no hubiese sido lo mismo sin \xe9l, la recordaremos por siempre al igual que cada uno de los momentos especiales que tuvimos. Gracias Aitor por ser la banda sonora de nuestra comedia rom\xe1ntica, vivimos un sue\xf1o que jam\xe1s olvidaremos.",q,p),A.hH("Alicia","13/12/2024","Antes de saber que la hacienda trabajada con ellos yo ya hab\xeda visto a Aitor por redes sociales y dije, yo si me caso necesito a este se\xf1or en mi vida.Y qu\xe9 raz\xf3n ten\xeda, pedazo de DJ. Nos ha creado la mejor fiesta de nuestra vida. No lo cambiamos por nada del mundo.",q,p),A.hH("Javier","05/12/2024","Cristina y yo los casamos el d\xeda 30 y la verdad que solo podemos decir que menudo fiest\xf3n nos prepararon Javi Carrera y Aitor, nos lo dijeron todos los invitados! Solo agradecer el trato dado por vosotros y el magn\xedfico trabajo que hicieron!",q,p),A.hH("Violeta","02/12/2024","Voy a dejar por aqu\xed mis votos al se\xf1or Aitor, porque una rese\xf1a es algo impersonal y Aitor te hace sentir tsn especial desde el minuto 1 qu\xe9 s\xf3lo se merece una declaraci\xf3n de amor. Aitor, mil gracias por hacer de un d\xeda cualquier el d\xeda m\xe1s especial de mi vida, gracias por poner todo tu coraz\xf3n en nuestra boda y gracias por estar siempre qu\xe9 te hemos necesitado. Gracias tambi\xe9n por hacer de una idea, un sue\xf1o y de un sue\xf1o una realidad, si me volviera a casar te dir\xeda s\xed 10000000 veces m\xe1s \ud83e\udec2 Te queremos Juan y Violeta \u2764\ufe0f",q,p)],A.ac("z<wM>"))})
